import axios from 'axios';

interface Props {
	user: string;
	token: string
}

const SubmitReview = ({user, token}: Props) => {
	const reviewData = {
		review: "wow it was great"
	}
  axios.patch("http://0.0.0.0:8000/d790c144-5da2-4ef5-b278-e4840b0349f3/review/", reviewData, {
    headers: {
      Authorization: `Bearer ${token}`,
    },
  })
  .then((response) => {
	  console.log("successfully reviewed a game");
  })
  .catch((error) => {
	  console.log("review failed");
	  console.log(token);
  });
}

export default SubmitReview;
